You ever have those years (I like to call them â€œbanner yearsâ€), where everything either goes really well or your entire world flips upside down?

2013 was my first banner year: I was diagnosed with generalized anxiety, developed an eating disorder and almost failed social studies and chemistry because I couldnâ€™t motivate myself to do work. On top of that, a small cohort of my high school friends spread nasty rumours about me until I became severely depressed. This depression has followed me my entire life since. 

2016 was my second banner year: My dad passed away unexpectedly and my mom was diagnosed with breast cancer, this time in Stage 4. 

2019 was my third banner year: I went through (and recovered from) a horrible breakup, was verbally and sexually harassed by someone I trusted, lost touch with my friends and became even more body-dysmorphic.

The cynical parts of me look at this timeline and think â€œwow, every three years something really f***ed up happens in my lifeâ€. Whatever struggle Iâ€™m facing, whatever situation Iâ€™m dealing with â€” sometimes I just canâ€™t lookÂ at the bright side. Itâ€™s an awful feeling and it can leave you helpless and hopeless. 

But itâ€™s important to remain positive, when and if you can. In 2014 I got accepted into Mount Royal University and made an entirely new group of friends. In 2016 I travelled to Ireland with an amazing group of women during a travel abroad program. In 2018 I graduated university with a 4.0 GPA. In 2020, I wrote and recorded two original songs â€“ and I got a puppy!

Anyways, what Iâ€™m trying to get at here is that you are SO much stronger than you know. I didnâ€™t think I could make it through half of the crap life has thrown my way. But here I am, writing this blog in the hopes that I can inspire someone else to be strong.

You will have bad banner yearsâ€¦but you will also have good ones. The thing is to focus on the WHOLE picture. I know itâ€™s difficult, but trust me, you got thisâ™¥ï¸

