I love that people post up the hotline for suicide. But I also want to say that this is not a fix. Iâ€™ve called the suicide hotline twice. It helped me get thru the really dark place I was but I was also put on hold once. And the next day, I was on my own again. They are there to help you step out of that moment of darkness but if you really want to help someone who is suicidal or depressed, show up. Bake a casserole and hang out. Watch a movie. Check on them daily til theyâ€™re out of the woods. Get them out of the house and take a walk. Bring them their favorite food. People who are depressed or suicidal get to a point where everything just falls apart and theyâ€™re sitting in the middle of it all and have no idea how to patch things up. Be there to help patch things up and make their life a little easier so everything is not so overwhelming. Theyâ€™ll rarely ask for this but if you can be this person, you have no idea how much that can change things. To shine a little light in their darkness until they can hold their own ğŸŒŸ Like i said in my last post, depression will sit there and spin a story of worthlessness and so to ask for help feels like being a burden. Theyâ€™re afraid theyâ€™ll lose their friends or be seen as crazy. Those are the moments they need love and kindness the most.
